import csv
import numpy as np
import pandas as pd
from sklearn import metrics
from sklearn.metrics import precision_recall_fscore_support

"""计算每条test日志的p_value和confidence,并打上相应的label"""
def p_value(Input_filepath, sig):

    with open(Input_filepath, 'r') as csvfile:
        reader = csv.reader(csvfile)
        column_N = [row[0] for row in reader]
    list_N = map(float, column_N)
    row_length = len(column_N)

    with open(Input_filepath, 'r') as csvfile:
        reader = csv.reader(csvfile)
        column_A = [row[1] for row in reader]
    list_A = map(float, column_A)

    column_length = 3

    distList = []
    distMat = np.zeros((row_length, column_length))
    for i in range(0, row_length):

        if list_N[i]>list_A[i]:
            distMat[i][0] = list_N[i]
            distMat[i][1] = (1.0-list_A[i])
            distMat[i][2] = 0
            if distMat[i][1] >= sig:
                distMat[i][2] = 0
            else:
                distMat[i][2] = 1

        elif list_N[i]<list_A[i]:
            distMat[i][0] = list_A[i]
            distMat[i][1] = (1.0 - list_N[i])
            distMat[i][2] = 1
            if distMat[i][1] >= sig:
                distMat[i][2] = 1
            else:
                distMat[i][2] = 0

        distList.append(distMat[i][2])
    distArray = np.array(distList)
    return distArray
    #np.savetxt(Output_filepath, distMat, delimiter=',')
    #return Output_filepath, distArray

